package com.qakeshav.javaconcept;

public class Hellojava {
  
	public Hellojava() {
		System.out.println("This is Default Cons");
	}
	
	public Hellojava(int i) {
		System.out.println("Parent Class Cons with value of i: "+i);
	}
	
	public Hellojava(int i,int j) {
		System.out.println("Parent Class Cons with value of i: "+i);
		System.out.println("Parent Class Cons with value of j: "+j);
	}
	
	
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
System.out.println("This is java concept package ");
		System.out.println("This is java concept package ");
		System.out.println("This is java concept package ");
	}

}
